I'm going to guide you through creating a simple Chrome extension that takes screenshots of the current webpage and saves them to the user's local machine. This extension will have a single button in the toolbar that, when clicked, will trigger the screenshot and save it to the user's Downloads folder.

1. **Create a new directory** for your extension and navigate into it.

2. **Create a manifest file**: Create a new file named `manifest.json` and add the following content:

```json
{
  "manifest_version": 2,
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Takes screenshots of the current webpage",
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  },
  "permissions": ["activeTab", "downloads"]
}
```

3. **Create an icon**: Create a 128x128 pixel icon named `icon.png` in the extension directory. You can use any image editor to create this icon.

4. **Create the popup**: Create a new file named `popup.html` and add the following content:

```html
<!DOCTYPE html>
<html>
  <head>
    <script src="popup.js"></script>
    <style>
      button {
        height: 30px;
        width: 100px;
      }
    </style>
  </head>
  <body>
    <h1>Screenshot Extension</h1>
    <button id="takeScreenshot">Take Screenshot</button>
  </body>
</html>
```

5. **Create the popup script**: Create a new file named `popup.js` and add the following content:

```javascript
document.getElementById('takeScreenshot').addEventListener('click', async () => {
  const screenshot = await chrome.tabs.captureVisibleTab(null, {});
  const blob = await (await fetch(screenshot)).blob();
  const url = URL.createObjectURL(blob);
  const a = document.createElement('a');
  a.href = url;
  a.download = `screenshot_${Date.now()}.png`;
  a.click();
  URL.revokeObjectURL(url);
});
```

6. **Load your extension into Chrome**:

   a. Open Chrome and navigate to `chrome://extensions/`.

   b. Enable "Developer mode" by toggling the switch in the top right corner.

   c. Click the "Load unpacked" button and select your extension directory.

Your extension should now be active, and you should see its icon in the Chrome toolbar. Clicking the icon will open a popup with a "Take Screenshot" button. When you click this button, the extension will take a screenshot of the current webpage and save it to your Downloads folder.

